export default function defaultSettings (file, length) {
    const fs = require("fs");
    let defaultRes = [];
    console.log("FILE IS : ", file);
    let res = new Promise(resolve => {
        fs.readFile(file, 'utf8', (err, data) => {
            if (err) {
                console.error(err);
                return
            }
            resolve(data)
        })
    });
    console.log("RESULT IS :", res);
    let lines = res.split('\n');
    for (let line = 1; line < lines.length; line++) {
        let subResult = [];
        let elements = lines[line].split(',');
        subResult.push(elements[0]);
        elements = elements.slice(1, length);
        for (let i = 0; i < elements.length; i++) {
            subResult.push(parseInt(elements[i]));
        }
        defaultRes.push(subResult);
    }
    console.log(defaultRes);
    return defaultRes;
}
